import React from "react";
import "./custom-button.styles.scss";
import { CustomButtonContainer } from "./custom-button.styles";
const CustomButton = ({
  children,
  isGoogleSignIn,
  inverted,
  ...otherProps
}) => <CustomButtonContainer {...otherProps}>{children}</CustomButtonContainer>;

export default CustomButton;
